import React from 'react';

const view = (props) =>{
    return (<div className={props.ownClass} onClick={(props) => this.goTo(props)}>
        <div className="text-button">{props.label}</div>
    </div>)
};

function goTo(props){
    console.log('boton clickeado: '+props.label);
}

class HomeBigButton extends React.Component {

    constructor(props) {
        super(props);
    }



    render(){
        return view(this.props);
    }
}

export default HomeBigButton;
